textfsm_template:
Value NAME (\S+)
Value SWITCHPORT (Enabled|Disabled)
Value ADMIN_MODE (dynamic desirable|dynamic auto|static access)
Value OPER_MODE (dynamic auto|static access|down)
Value ADMIN_ENCAP (dot1q)
Value OPER_ENCAP (native)
Value NEGOTIATION (On|Off)
Value ACCESS_VLAN (\d+|none)
Value TRUNK_VLAN (\d+ \(default\)|none)

Start
  ^Name: ${NAME}
  ^\s*Switchport: ${SWITCHPORT}
  ^\s*Administrative Mode: ${ADMIN_MODE}
  ^\s*Operational Mode: ${OPER_MODE}
  ^\s*Administrative Trunking Encapsulation: ${ADMIN_ENCAP}
  ^\s*Operational Trunking Encapsulation: ${OPER_ENCAP}
  ^\s*Negotiation of Trunking: ${NEGOTIATION}
  ^\s*Access Mode VLAN: ${ACCESS_VLAN}
  ^\s*Trunking Native Mode VLAN: ${TRUNK_VLAN}\s*$$ -> Record
